INSERT INTO `contentkpi` VALUES (2,'','55','2016-07-27 07:00:35','\r\n测试分值：实际分值/目标值×45×权重\r\n研发分值：实际分值/目标值×75×权重\r\n实验室建设分值：实际分值/目标值×75×权重\r\n','工作完成情况','\r\n实际现场测试+写报告天数 计入测试天数\r\n实际研发天数 计入研发天数\r\n实际实验室建设天数 计入实验室建设天数，未从事安排的实验室建设工作 不能作为实验室建设工作，应计入写报告。\r\n    \r\n测试分值目标值=实际测试天数/本季度总工作天数*原职级总分值\r\n研发分值目标值=实际研发天数*0.8\r\n实验室建设目标值=实际实验室建设天数*0.7\r\n三项累计，上限55分。',0,'kpi',55,8,110),(3,'','','2016-07-24 09:26:48','室效率值=室总测试分/室总测试天数','测试分值','（60+（（实际分值-室效率值*目标分值）/（室效率值*目标分值））*40）*权重',0,'kpi',0,NULL,37),(4,'','','2016-07-24 09:28:32','','实验室建设','根据实验室建设进度和质量考评',0,'kpi',0,NULL,37),(8,'',NULL,'2016-07-26 13:03:40','每季度初下达研发任务及培训考核计划。\r\n当季度正常完成培训考核计划可获得70%；\r\n考核计划之外完成项目授权可加分；\r\n参与新研发项目可加分；\r\n满分5分。\r\n','培训',NULL,0,'gs',5,15,70),(9,'',NULL,'2016-07-26 13:03:48','互助协作、主动配合、具有团队精神','团队协作',NULL,0,'gs',5,15,70),(11,'',NULL,'2016-07-26 13:03:59','正常情况得70%;\r\n当季度多次承担困难或紧急任务可获得加分。\r\n当季度承担下班培训可加分\r\n','执行力',NULL,0,'gs',10,15,70),(12,'','','2016-08-22 11:36:05','室效率值=室总测试分数/室总测试天数','测试分值','（70+（实际分值-室效率值*目标值）/（室效率值*目标值）*30）*指标权重',0,'kpi',0,15,70),(13,'','','2016-07-26 13:02:47','考核实验室建设情况','实验室建设','根据实验室建设进度和质量考评：\r\n实验室建设完成效率和质量满足要求可得此项分值的70-80%；\r\n实验室建设完成效率较高和质量较好可得此项分值的80-90%；\r\n实验室建设完成效率和质量优秀可得此项分值的90%以上；\r\n',0,'kpi',0,15,70),(14,'','','2016-07-26 13:02:58','Debug服务质量；\r\n按规定时间出具准确无误报告；\r\n','测试质量','Debug服务客户满意，按时、无差错完成测试并出具报告得70%。\r\nDebug未按照服务质量执行，发现一次扣2分\r\n未能按时出报告1份减5分；\r\n发生一次已发给客户的报告出错，减5分；\r\n存在错漏检1次减10分；\r\n报告审核人员认为质量差，报告返工一次减2分。\r\n此项可能为负分\r\n',0,'kpi',15,15,70),(15,'','','2016-07-26 13:03:07','填写工作日志和仪器设备使用记录情况填写情况；\r\n原始记录等其他质量体系执行情况；\r\n负责所分配debug室环境秩序的维护；\r\n','质量体系','各项规定均遵守，无违规现象可得70%；\r\n根据执行的质量优异程度适当加分。\r\n如果设备管理员和质量系统管理员或项目经理反馈违规情况，则在70%基础上，1次扣1分，最多可扣到-5分。\r\n',0,'kpi',5,15,70),(16,'','','2016-07-26 13:03:16','有效客户投诉次数(由于测试人员服务不到位产生的投诉)','客户投诉（减分项）','每发生有效投诉1次，扣5分',0,'kpi',0,15,70),(17,'',NULL,'2016-07-25 12:52:37','为部门或公司挖掘了新业务新项目可获得5分加分；\r\n提出重大建设性意见和建议获得采纳和应用可获得5分加分。\r\n','重大项目或建设性建议（加分项）',NULL,0,'gs',0,15,37),(18,'',NULL,'2016-07-25 12:55:43','描述项目主要任务\r\n