检测报告209份，严格按照当天报告当天发的宗旨执行；\r\n7、处理客户咨询900余次，客户邮件咨询，均当天完成，如当天无法完成则继续跟进，每天向客户反馈，耐心仔细为送检厂家解决问题，把客户放在第一位。提高时效性的同时也要保证准确性；\r\n8、完成脚本POS、直联等项目的合同升级。\r\n',NULL,'2016-08-30 14:43:27','1、按照公司规定及相关要求及时处理客户业务需求；\r\n2、按要求处理客户送检合同或协议；\r\n3、信息系统正确录入客户测试信息；\r\n4、按照客户要求结合实验室业务情况为客户预约测试时间，并发给客户确认；\r\n5、按要求及时向客户提供已经出具的检测报告；\r\n6、及时准确回复客户咨询，帮助客户解决问题。\r\n','业务工作',NULL,7.275,'gs',50,107,137),(698,'1、二季度共拜访客户5家（驰卡、证通、优博讯、天喻、实达），通过现场及电话拜访，更多的了解客户问题及市场环境，了解客户的需求，提高客户粘性，维护客户关系，抓稳市场，上门为客户解答送检疑问及新动态、新项目宣传，然后通过拜访了解客户的研发情况与测试安排，及市场趋势，提前做好迎接各厂家大批量送检的准备；\r\n2、根据客户反馈信息，结合实验室设备条件，挖掘新测试需求，为企业制定定制化测试，提供咨询培训服务；向客户了解其它竞争对手实验室动态，做好战略准备；\r\n3、二季度接待新老客户上门咨询20次（如百瑞互联、鼎元科技、掌贝、智谷、怡化等），系统化介绍整个送检流程及注意事项，有效的培养了客户习惯，使客户正确理解检测认证各环节，有效避免客户的错误判断，大大提高了客户满意度及客户体验，抓住每一个潜在客户，同时了解客户背景及需求，通过合理营销，推广公司创新项目；老客户则更多的了解检测中心日常运行，工作制度，配合老客户合理安排送检排期。\r\n',NULL,'2016-08-30 14:43:51','1、按照分公司业务发展需要，不定期对周边客户进行拜访；\r\n2、客户拜访过程中了解客户业务需求及检测计划，为业务决策提供参考；\r\n3、与客户建立亲密的业务伙伴关系，增加客户黏性，挖掘潜在客户资源和业务需求。\r\n','客户拜访',NULL,2.175,'gs',15,107,137),(699,'1、完成内部外部消防检查5次，每月例行检查灭火器、消防栓、消防通道等消防设施是否完好，消除一切安全隐患；\r\n2、严格按制度控制检测技术部电脑USB口的开启及关闭情况，及服务器正常巡检；\r\n3、配合总公司，针对新系统电脑，安装新版本USB口管理工具。\r\n',NULL,'2016-08-30 14:44:08','1、负责日常消防安全管理，及时解决消防问题；\r\n2、管理服务器密码、技术部门USB接口密码，按照安全规定进行服务器开启、关闭，USB接口开启、关闭。\r\n','安全管理',NULL,0.675,'gs',5,107,137),(700,'易耗品严格按要求发放并做以登记，保留原始凭证。保证账实相符，每月进行一次盘点，并及时提出采购申请。',NULL,'2016-08-30 14:55:15','1、负责易耗品库房管理，按照公司规定开展易耗品的领用登记；\r\n2、根据库存情况及时提出办公用品采购申请，并完成部分采购；\r\n3、配合相关人员完成易耗品库存盘点，确保帐物相符。\r\n','易耗品管理',NULL,0.675,'gs',5,107,137),(701,'1、车辆管理：车辆正常清洗及保养，严格按照要求管理及使用车辆；\r\n2、二季度脚本POS、直联、UICS卡片及终端等项目进行6次升级，每次升级及时更新合同及文档，向厂家及检测技术部转发最新版送检指南；\r\n',NULL,'2016-08-30 14:45:07','1、根据公司和各部门需求及部门安排按时完成采购任务；\r\n2、按照公司要求牵头进行2.4G实验室建设工作；\r\n3、完成部门交办的其他临时性工作。\r\n','其他工作',NULL,0.675,'gs',5,107,137),(702,'充分理解领导意图，按要求，认真执行上级命令，只有服从和执行，不抱怨，没有消极态度，积极做好老员工带头作用，主动承担工作职责之外的临时事务，多担当，提高良好的工作氛围。下班后主动检查公司各房间门窗、水电等安全情况。',NULL,'2016-08-30 14:45:25','对领导意图的理解和对工作任务的执行情况；服从工作安排，不计个人得失，以大局为重的情况','执行力',NULL,1.2,'gs',10,107,137),(703,'1.二季度参加部门组织培训3次，如互联网金融、U架构TPOS、项目升级培训，通过项目培训，加深业务工作对项目的认识和理解，有效帮助了在日常业务工作中，解答厂家问题。\r\n2.外部通过向厂家学习，日常DEBUG的接触，上门拜访，及专程去企业学习，来满足对业务工作开展的需求。\r\n3.收集厂家意见及企业情况，结合目前工作制度，提出意见，提高工作效率。\r\n',NULL,'2016-08-30 14:45:41','对技术、业务的学习钻研并在工作方法和工作研究中有所创新或突破的情况；对工作提出建设性意见和建议，或有价值的信息，且被采纳和使用的情况','学习和进取精神',NULL,1.35,'gs',10,107,137),(704,'','0','2016-08-30 16:10:36','有效客户投诉次数(由于业务人员服务不到位产生的投诉)','客户投诉','每发生有效投诉1次，扣5分',0,'kpi',0,119,138),(705,'传统业务处理：能严格按照公司规定，及时完成客户合同签订、系统下单、样品接收、Debug预约、报告发送，符合公司业务“五个一”规定的要求。\r\n境外业务处理：及时适应业务分工调整，按要求完成境外机构检测业务的处理，完成Smartro、SCSpro、IBM非接UICS项目的受理，完成CNCBI、ABC、UOB入网项目检测并发送检测报告。\r\n合同签订及系统下单：能按要求处理客户送检合同，在IMS上正确录入客户测试信息，二季度完成签订合同82份，并完成系统下单162个。\r\n预测试预约：能根据客户测试需求，结合实验室资源，及时完成客户debug测试的预约并发送客户。根据debug预约情况实时更新实验室可预约时间表，并通过微信公众平台及时通知客户，最大限度地利用实验室资源。二季度完成debug测试预约共900余天。\r\n报告发送：能按要求及时向客户发送已经出具的检测报告，当日16:30之前出具的报告，当天发送；当日16:30之后出具的报告，24小时之内完成发送。二季度完成报告发送73份。\r\n客户咨询通知：第一时间处理客户咨询，准确回复信息，让客户清晰了解业务内容和规则。二季度完成脚本POS升级、qPBOC、qUICS等6次项目升级的通知，并及时完成相关文档的更新。\r\n',NULL,'2016-08-30 16:11:01','1、按照公司规定及相关要求及时处理客户业务需求；\r\n2、按要求处理客户送检合同或协议；\r\n3、信息系统正确录入客户测试信息；\r\n4、按照客户要求结合实验室业务情况为客户预约测试时间，并发给客户确认；\r\n5、按要求及时向客户提供已经出具的检测报告；\r\n6、及时准确回复客户咨询，帮助客户解决问题。\r\n','业务工作',NULL,7.2,'gs',50,119,138),(706,'样品管理：严格按照公司制度规定及质量体系要求开展样品管理工作；完成样品接收、账册维护、样品流转及追踪；以及样品库管理工作。\r\n样品接收：对客户提交的样品、资料文档完整性及正确性进行审核；正确完成样品接收，避免报告出具过程中不必要的反馈，提高检测效率。二季度完成样品接收341个（其中终端样品303个，卡片样品38个）。\r\n样品账册：建立并优化样品台账，及时更新台账，完成台账双人备份，确保账物一致，为样品管理提供准确而便捷的数据支持。\r\n样品流转：对样品进行过程管理，完整填写、签署流程文档，准确地记录样品领用、借用、归还状态，做好台账。\r\n样品库管理：根据公司制度规定，管理样品间，按照分类原则保存样品，保证报告有据可依。\r\n样品核对：定期进行样品核对，通过对样品接收记录检查和库房抽检，保证了样品无误、帐物相符，确保检测报告有据可依。\r\n',NULL,'2016-08-30 16:11:38','1、按照公司制度规定及质量体系要求开展样品管理工作；\r\n2、按照要求对客户提交的样品、资料文档完整性进行审核；\r\n3、建立样品账册，确保其内容准确有效；\r\n4、样品流转过程中的流程文档按要求完整填写、签署，相关文档按要求保管；\r\n5、样品库的管理遵循公司制度规定，样品摆放有序；\r\n6、确保留样样品保存完整，帐物相符。\r\n','样品管理',NULL,3.675,'gs',25,119,138),(707,'客户拜访：二季度无客户拜访。\r\n临时性工作：高效完成部门的各项临时性工作，完成领导交办的指令性工作，如积极完成境外业务受理工作。\r\n',NULL,'2016-08-30 16:12:02','1、根据公司业务发展需要配合进行客户拜访工作；\r\n2、完成部门交办的其他临时性工作。\r\n','其他工作',NULL,0.75,'gs',5,119,138),(708,'能够准确理解领导的意图，严格执行工作任